import React from "react";

const TodoList = (props) => {
	const deleteitems = (id) => {
		console.log("deleted", id);
	};
	return (
		<div
			style={{
				display: "flex",
				flexDirection: "row",
				justifyContent: "center",
				alignItems: "center",
			}}
			key={props.key}
		>
			<i
				className="fa fa-times"
				aria-hidden="true"
				id="fatime"
				onSelect={deleteitems(props.key)}
				style={{
					color: "crimson",
					paddingRight: "20px",
					fontSize: "30px",
				}}
			/>
			<li
				style={{
					listStyle: "none",
					fontSize: "30px",
					fontFamily: "monospace",
					color: "black",
				}}
			>
				{props.text}
			</li>
		</div>
	);
};

export default TodoList;
